import React from 'react';
//styles
import './tile.scss';
//components and constants

const Tile = ({tileData}) => {
    const { title, icon } = tileData;

    return (
       <div className={'tile'}>
           <img src={icon} alt={'icon'} className={'tile-icon'}/>
           <h3 className={'tile-title'}>{title}</h3>
       </div>
    )
};

export default Tile;
